{"operationName":"getSingleSidedStakingCampaigns","variables":{"stakeTokenId":"0x6cacdb97e3fc8136805a9e7c342d866ab77d0957","userId":""},"query":"query getSingleSidedStakingCampaigns($stakeTokenId: String, $userId: String) {
  singleSidedStakingCampaigns(
    first: 100
    orderBy: endsAt
    where: {stakeToken: $stakeTokenId}
  ) {
    ...SingleSidedStakingCampaignFragment
    stakeToken {
      ...StakeTokenFragment
      __typename
    }
    rewards {
      ...SingleSidedStakingCampaignRewardFragment
      __typename
    }
    singleSidedStakingPositions(where: {stakedAmount_gt: 0, user: $userId}) {
      id
      stakedAmount
      __typename
    }
    __typename
  }
}

fragment SingleSidedStakingCampaignFragment on SingleSidedStakingCampaign {
  id
  owner
  duration
  startsAt
  endsAt
  locked
  stakingCap
  stakedAmount
  __typename
}

fragment StakeTokenFragment on Token {
  id
  symbol
  name
  decimals
  totalSupply
  derivedNativeCurrency
  __typename
}

fragment SingleSidedStakingCampaignRewardFragment on SingleSidedStakingCampaignReward {
  token {
    address: id
    name
    symbol
    decimals
    derivedNativeCurrency
    __typename
  }
  amount
  __typename
}"}
